import java.util.HashMap;import java.util.Scanner;import java.util.Stack;//Using stack and HashMappublic class BalancedParenthesisType2 {    public static void main(String[] args) {        Scanner sc = new Scanner(System.in);        String parenthesis = sc.next();        if(balanced(parenthesis))            System.out.println("Balanced");        else            System.out.println("Not balanced");    }    public static boolean balanced(String str){        HashMap<Character, Character> map = new HashMap<>();        map.put('(', ')');        map.put('{','}');        map.put('[',']');        Stack<Character> stack = new Stack<>();        for (int i = 0; i < str.length(); i++){            if(str.charAt(i) == '(' || str.charAt(i) == '{' || str.charAt(i) == '[')                stack.push(str.charAt(i));            else{                if(stack.isEmpty()) return false;                if(map.get(stack.peek()) != str.charAt(i))                    return false;                stack.pop();            }        }        if(stack.isEmpty()) return true;        return false;    }}